import React from 'react'
import classes from './Cart.module.css'


const Cart = () => {
    
    const CartItem = <ul>{[
       { id:'m2',
    Name:'Decaf', 
    description : 'Decaf coffee is brewed with these decaffeinated beans.' ,
    prize : 550 },  ].map((item) => <li>{item.Name}</li> 
    
    )} </ul>;

    return(
    

    <React.Fragment>
            <div className={classes['cart-items']}>{CartItem}</div>
           <div className={classes.total}> <span >Total</span>
            <span>330</span> </div>
            <div>
                <button>Close</button>
                <button>Order</button>
            </div>
    </React.Fragment>
    )
}
export default Cart;
